import React from 'react';
import {useForm} from 'react-hook-form';

function App() {
  const {register, handleSubmit, errors} = useForm();
  const onSubmit = data => {
    console.log(data);
  };
  return (
    <div >
      <form onSubmit={handleSubmit(onSubmit)}>
        <input type="text" 
               placeholder="todo" 
               name="todo"
               ref={register({
                      required:"Todo item required",
                      minLength:{value:3, message:"3 char min"}
               })}/>
      {errors.todo && <p>errors.todo.message</p>}
      <input type="submit" />
      </form>

    </div>
  );

};

export default App;
